import './App.css';
import Row from './Row';
import request from './request';

function App() {
  return (
    <div className="App">
      <Row title="NETFLIX ORIGINAL" fetchURL={request.fetchNetflixOriginals} />
      <Row title="NETFLIX RATED"fetchURL={request.fetchTopRated}/>
    </div>
  );
}

export default App;
